import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import CapName from "../Hooks/Capitalize";
import backGroundTest from "../Hooks/Background";
import "./pokepage.css";

function Move() {
    const { name } = useParams();
    const [pokeMove, setPokeMove] = useState([]);
    const currentMove = `https://pokeapi.co/api/v2/move/${name}`;
    const [isLoading, setIsLoading] = useState(true);

    async function GetMove() {
        setIsLoading(true);
        const res = await axios.get(currentMove);
        setPokeMove(move => {
            move = [...move, res.data]
            return move
        });
        setIsLoading(false);
    }
}

export default Move;
